.noticeCmdN{
    position: absolute;
    margin-left: 15px;
    margin-top: -5px;
    border-radius: 50%;
    background: #e22a67;
    width: 20px;
    height: 20px;
    color: #fff;
}

@media screen and (min-width: 600px) {
    .mobileA{
        display: none;
    }
}


.nav-item .nav-link{
    color: rgba(255, 255, 255, 0.5);
    display: flex;
    flex-direction: column;
    justify-content: center;
    text-align: center;
    text-transform: capitalize;
}

.nav-item .championship {
    position: relative;
}

.nav-item .icon-live {
    position: absolute;
    bottom: -2px;
    left: 50%;
    transform: translateX(-50%);
}
.v-nav-menu .feather-icon{
      margin-right: 0;
}

.v-nav-menu a{
  padding: 10px;
}
.v-nav-menu .router-link-active .textLink{
  background: transparent;
  box-shadow: none;
  color: #facc4f !important;
}
.v-nav-menu .router-link-active .fill-color{
    fill: #facc4f
}
.v-nav-menu .router-link-active .stroke-color{
    stroke: #facc4f;
}
#leftSidebar{
    position: fixed !important;
    height: calc(100% - 80px);
    width: 105px;
    -webkit-box-pack: justify;
    -ms-flex-pack: justify;
    justify-content: space-between;
    z-index: 99999999;
}
@media screen and (max-width: 689px) {
    #leftSidebar{
        zoom: .9;
    }
}

#leftSidebar .nav-link{
    position: relative;
}
#leftSidebar .nav-link.new:before {
    position: absolute;
    top: 0;
    right: 15px;
    background: url('~@/assets/images/sky/icon-new.svg');
    display: block;
    overflow: hidden;
    width: 25px;
    height: 21px;
    content: "";
    background-size: 100% 100%;
}
.iconLive {
    position: absolute;
    top: 18px;
    left: 50%;
    -webkit-transform: translateX(-50%);
    transform: translateX(-50%);
    -ms-flex-item-align: center;
    align-self: center;
}

.textLink {
    color: #fff;
    text-transform: unset;
    word-wrap: break-word;      /* IE 5.5-7 */
    white-space: -moz-pre-wrap; /* Firefox 1.0-2.0 */
    white-space: pre-wrap;      /* current browsers */
}
.topSidebar{
    height: calc(100% - 65px);
    overflow-y: auto;
    width: 105px;
    -webkit-box-pack: justify;
    -ms-flex-pack: justify;
    justify-content: space-between;
    z-index: 99;
}
